import { Link } from "react-router-dom";

export function RestaurantCard({
    name,
    rating,
    type,
    number_of_votes,
    price_starts_from,
    id
}) {

    // console.log("name")
    return (
        <tr data-testid="item">

        <Link to = {`/restaurants/${id}`}>

        <td data-testid="name">
        {name}
        </td></Link>

            <td data-testid="rating">
                {rating}
            </td>
            <td data-testid="type">
                {type}
            </td>
            <td data-testid="votes">
                {number_of_votes}
            </td>
            <td data-testid="price">
                {price_starts_from}
            </td>
        </tr>
    )
}
